	def return_dups_hash array
		dups = {}
		array.uniq.each do |val|
			dups[val] = array.count(val)
		end
		return_dups
	end

	def straight?(array)
		conv_array = []
		array.each do |card|
			case card
			when "K"
				conv_array << 13
			when "Q"
				conv_array << 12
			when "J"
				conv_array << 11
			when "A"
				conv_array << 14
			else
				conv_array << card.to_i
			end
			conv_array.sort!
			if conv_array[4] - conv_array[0] == 4
				return true
			else
				conv_array = conv_array.map {|x| x == 14 ? 1 : x }
				conv_array.sort!
				if conv_array[4] - conv_array[0] == 4
					return true
				else
					return false
				end
			end
		end
	end


